import React from 'react';

const Student = ({ student, onDelete, onEdit }) => {
    return (
        <div className="card mb-3">
            <div className="card-body">
                <h5 className="card-title">{student.name}</h5>
                <p className="card-text">Age: {student.age}</p>
                <p className="card-text">Grade: {student.grade}</p>
                <button onClick={() => onEdit(student)} className="btn btn-primary mr-2">Edit</button>
                <button onClick={() => onDelete(student.id)} className="btn btn-danger">Delete</button>
            </div>
        </div>
    );
}

export default Student;
